from datetime import datetime

from sqlalchemy import Integer, Column, String, DateTime, \
    ForeignKey, Sequence, text, Index
from sqlalchemy.dialects.postgresql import UUID, JSONB

from fusion_models.tenant.base import ClientBase


class File(ClientBase):
    __tablename__ = 'files'

    id = Column(UUID(as_uuid=True), primary_key=True)
    name = Column(String(64), nullable=False)
    source_system_interface_id = Column(Integer, ForeignKey(
        'source_system_interfaces.id'), nullable=True)
    type = Column(Integer, nullable=True)
    additional_info = Column(JSONB, nullable=True)
    total_records = Column(Integer, nullable=True)
    status = Column(String(64), nullable=False)

    created_on = Column(DateTime, server_default=text('(now() at time zone '
                                                      '\'utc\')'))
    modified_on = Column(DateTime, onupdate=datetime.utcnow)


